import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <div className="w-64 bg-white shadow-md h-screen p-4">
      <h2 className="text-lg font-bold mb-6">Contracts Dashboard</h2>
      <nav className="flex flex-col gap-4">
        <Link to="/dashboard" className="hover:text-blue-600">Contracts</Link>
        <button className="text-gray-500 cursor-not-allowed">Insights</button>
        <button className="text-gray-500 cursor-not-allowed">Reports</button>
        <button className="text-gray-500 cursor-not-allowed">Settings</button>
      </nav>
    </div>
  );
};

export default Sidebar;
